import React from "react";
import styles from "./users.module.css";

let Users = (props) => {

    if (props.users.length === 0) {
        props.setUsers([
            {
                id: 1,
                photoUrl: "data:image/jpeg;base64,",
                followed: false,
                fullName: "Dmitriy",
                status: "Im a boss",
                location: {city: "Minsk", country: "Belarus"}
            },
            {
                id: 2,
                photoUrl: "data:image/jpeg;base64,",
                followed: true,
                fullName: "Dmitriy",
                status: "Im a bos",
                location: {city: "Moscow", country: "Russia"}
            },
            {
                id: 3,
                photoUrl: "data:image/jpeg;base64,",
                followed: false,
                fullName: "Dmitriy",
                status: "Im a bosss",
                location: {city: "Kiev", country: "Ukraine"}
            }])
    }
    return (
        <div>
            {
                props.users.map(u => <div key={u.id}>
                    <span>
                        <div>
                            <img src={u.photoUrl} className={styles.userPhoto}/>
                        </div>
                    </span>
                    <span>
                        {u.followed
                            ? <button onClick={() => {
                                props.unfollow(u.id)
                            }}>Unfollow</button>
                            : <button onClick={() => {
                                props.follow(u.id)
                            }}>Follow</button>}
                    </span>
                    <span>
                        <span>
                            <div>{u.fullName}</div>
                            <div>{u.status}</div>
                        </span>
                        <span>
                            <div>{u.location.country}</div>
                            <div>{u.location.city}</div>
                        </span>
                    </span>
                </div>)
            }
        </div>
    )
}

export default Users;